import React from "react";
import "./UserHome.css";
import Navbar from "../components/Navbar.js";


class UserHome extends React.Component {


  render() {
    let userRecordString = sessionStorage.getItem("userRecord");
    let userRecord = JSON.parse(userRecordString);
    // now we have a json record of the user inside 'userRecord'

    return (
      <>
        <Navbar page="Account" />
        <h1> Welcome, <span>{userRecord.fname}</span>&nbsp;<span>{userRecord.lname}</span>!</h1>
        <div className="row">
          <div className="col-sm-6">
            <div className="card">
              <div className="card-body">
                <h5 className="card-title">Special title treatment</h5>
                <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
                <a href="#" className="btn btn-primary">Go somewhere</a>
              </div>
            </div>
          </div>
          <div className="col-sm-6">
            <div className="card">
              <div className="card-body">
                <h5 className="card-title">Special title treatment</h5>
                <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
                <a href="#" className="btn btn-primary">Go somewhere</a>
              </div>
            </div>
          </div>
        </div>
      </>
    )
  }
}
export default UserHome;
